          \\ #\z #\space #\newline (+ . ) let* set! unquote-splicing
          ;
    //var st : State = .{ .yyinput = text, .yylimit = text.len };
    var lexer = Lexer.init(text);
    var t: Token = lexer.nextToken();
    while (t.id != .eof) {
       std.debug.print("token: {any} {s}\n", .{t.id, t.slice(text)});
       t = lexer.nextToken();
    }
}
